insert into osc_languages_definitions (id, languages_id, content_group, definition_key, definition_value) values ('12785', '12', 'search', 'search_help', 'As palavras-chave são separadas por \"AND\" ou \"OR\" para um maior controle dos resultados da Busca.<br /><br />Por exemplo, <u>Teclado AND mouse</u> gerará um resultado em que contém sómente ambas as palavras. Entretanto, para <u>mouse OR teclado</u>, retornará um resultado que contém uma ou outra palavra.<br /><br />Termos exatos poderão ser encontrados colocando-os entre aspas.<br /><br />Por exemplo, <u>\"Computador notebook\"\"</u> retornará um resultado dos dois termos exatos.<br /><br />Os parenteses podem ser usados para valores adicionais ao resultado.<br /><br />Por exemplo, <u>Microsoft and (keyboard or mouse or \"visual basic\")</u>.');
