insert into osc_languages_definitions (id, languages_id, content_group, definition_key, definition_value) values ('12725', '12', 'info', 'ssl_check_box_contents', 'Nós validamos a identificação da Sessão de SSL (criptografia para manter sua Identidade e Informações Confidenciais em Segurança) gerada automáticamente por seu navegador em cada abertura de página segura feita pelo usuário.<br /><br />Esta validação assegura que é voce que está navegando neste Local com sua Conta e não outra pessoa.');
insert into osc_languages_definitions (id, languages_id, content_group, definition_key, definition_value) values ('12724', '12', 'info', 'ssl_check_box_heading', 'Privacidade e Segurança');
insert into osc_languages_definitions (id, languages_id, content_group, definition_key, definition_value) values ('12723', '12', 'info', 'cookie_usage_box_contents', 'Voce deve liberar os cookies em seu navegador para que possa continuar comprando, para que possamos garantir sua segurança.<br /><br />Abrindo a liberação dos cookies no seu navegador, a comunicação é reforçada sabendo-se que é voce que está fazendo transações em seu nome, e não outros que estejam usando de seu nome para fazer compras conosco e para prevenir que suas Informações Confidenciais não vazem para pessoas inescrupulosas. Para que possamos manter Sua Segurança .');
