insert into osc_languages_definitions (id, languages_id, content_group, definition_key, definition_value) values ('12703', '12', 'info', 'ssl_check', 'Nós detectamos que o seu navegador usou uma ID diferente durante as sessões em SSL.<br /><br />Por razões de segurança voce deverá entrar novamente com seu login para continuar comprando online.<br /><br />Determinados navegadores não tem a capacidade de gerar automáticamente sua Identificação segura nos níveis que exigimos. Se voce usa tal navegador nós recomendamos que voce reinicie a sessão com o <a href=\"http://www.microsoft.com/ie/\" target=\"_blank\">Microsoft Internet Explorer</a>, <a href=\"http://www.mozilla.com/firefox/\" target=\"_blank\">Firefox</a>, ou <a href=\"http://www.opera.com\" target=\"_blank\">Opera</a> para continuar sua compra com segurança. Use nossos links para baixar as últimas gerações desses navegadores..<br /><br />Desculpe-nos a inconveniência causada, mas é para seu próprio benefício que tomamos essas, entre outras, medidas de segurança.<br /><br />Contate-nos se voce tiver qualquer dúvida com relação à esta nossa exigência, ou com relação a quaisquer outras dúvidas. Obrigado .');
insert into osc_languages_definitions (id, languages_id, content_group, definition_key, definition_value) values ('12702', '12', 'info', 'cookie_usage', 'Nós detectamos que seu browser não dá suporte a cookies ou está bloqueando-os.<br /><br />Para continuar comprando online nós precisamos que sejam liberados.<br /><br />Para <b>Internet Explorer</b>, siga as instruções :<br /><ol><li>Clique em Ferramentas no Menu Principal e selecione opções de Internet</li><li>Encontre e selecione Segurança e coloque o nível de segurança para Médio</li></ol>Desculpe-nos pela incoveniencia,mas nós tomamos esta medida de segurança para seu benefício.<br /><br />Contate por favor a Caiçara Brasil para tirar as dúvidas relacionadas a esta nossa exigência.');
